webpackJsonp([0x73064009e7e8],{"./node_modules/json-loader/index.js!./.cache/json/example.json":function(e,t){e.exports={data:{markdownRemark:{html:'<p>This is a lead paragraph with dominant styles that make it stand out from the content below, this can be used to introduce the follwoing content and provide context for people skimming page content</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 750px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.68%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="alt text"\n        title="Alt text for the image"\n        src="/static/4b685e8104e18224e0a9a59f7d11d6d9-fde49.jpg"\n        srcset="/static/4b685e8104e18224e0a9a59f7d11d6d9-52f6e.jpg 320w,\n/static/4b685e8104e18224e0a9a59f7d11d6d9-5cb1f.jpg 640w,\n/static/4b685e8104e18224e0a9a59f7d11d6d9-fde49.jpg 1280w,\n/static/4b685e8104e18224e0a9a59f7d11d6d9-5460d.jpg 1920w,\n/static/4b685e8104e18224e0a9a59f7d11d6d9-d4800.jpg 2500w"\n        sizes="(max-width: 750px) 100vw, 750px"\n      />\n    </span>\n  </span>\n  </p>\n<p>This is a standard paragraph, it makes up the majority of page content. Paragraphs should be short in length and use a tone that makes content easily discoverable. This can be achieved with text formatting such as super text along with sub text or using text styles to highlight content using <strong>strong (or bold) text</strong> or <em>emphasis (or italic) text</em>, or maybe underline text, as well as strikethrough text for redacted content.</p>\n<blockquote>\n<p>You can even include a quote which will break up content that surrounds it.</p>\n</blockquote>\n<h3>A level 3 heading</h3>\n<p>Using headings to breakup content is the simplist and most effective way to draw the user\'s attention to each context within a page. It also helps break up content visually which makes larger content easier to read.</p>\n<p>Sometimes content will need to be formatted in other ways including:</p>\n<ul>\n<li>Unordered lists</li>\n<li>with mutiple</li>\n<li>list items.</li>\n</ul>\n<p>As well as:</p>\n<ol>\n<li>Ordered lists</li>\n<li>with mutiple</li>\n<li>list items.</li>\n</ol>\n<p>Text content can also have <a href="#">links</a> which should be visually identifiable from other content either through contrast (colour) or using underlines.</p>',frontmatter:{path:"/example",tags:["example"],title:"Example"}}},pathContext:{prev:{excerpt:'Variants "weight" variants for each primary color value for 100-900 shades of the initial color, with 500 being the initial color and 100-400 being variants of the tint going lighter and 600-900 being variants of the shade going darker22 Palette…',html:'<h2>Variants</h2>\n<p>"weight" variants for each primary color value for 100-900 shades of the initial color, with 500 being the initial color and 100-400 being variants of the tint going lighter and 600-900 being variants of the shade going darker22</p>\n<h3>Palette</h3>\n<ul>\n<li>Primary</li>\n<li>Secondary</li>\n<li>Tertiary</li>\n</ul>\n<h3>Shades</h3>\n<ul>\n<li>Light</li>\n<li>Grey</li>\n<li>Dark</li>\n</ul>\n<h3>Indicators</h3>\n<ul>\n<li>Info</li>\n<li>Success</li>\n<li>Warning</li>\n<li>Error</li>\n</ul>\n<h2>States</h2>\n<ul>\n<li>Hover</li>\n<li>Active</li>\n</ul>\n<h2>Color fucntions</h2>',id:"/Users/bigfish/Projects/guide/src/pages/color/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{path:"/color",tags:["color"],title:"Color"}},next:{excerpt:"Constraints Browser support Inline SVG (IE9+) SVG   not supported in IE, polypill using  svg4everybody Pixel alignment File Size Customisability Inheritance Structure Size Artboard Working with artboards that are multiples of 4px makes scaling SVGs…",html:'<h2>Constraints</h2>\n<ul>\n<li>\n<p>Browser support</p>\n<ul>\n<li>Inline SVG (IE9+)</li>\n<li>SVG <code>uses</code> not supported in IE, polypill using <a href="(https://github.com/jonathantneal/svg4everybody)">svg4everybody</a></li>\n</ul>\n</li>\n<li>Pixel alignment</li>\n<li>File Size</li>\n<li>Customisability</li>\n<li>Inheritance</li>\n</ul>\n<h2>Structure</h2>\n<h3>Size</h3>\n<h4>Artboard</h4>\n<p>Working with artboards that are multiples of 4px makes scaling SVGs to common sizes simple.</p>\n<p>The icon glyph should be designed to the smallest size it will render at, commonly this is either an artboard size of 8px or 16px. </p>\n<p>By working at on icons at the smallest base size scaling up to larger sizes is easy, with multiples used to scale the icon where needed, for example:</p>\n<ul>\n<li>16px × 1.5 24px</li>\n<li>16px × 2 = 32px</li>\n</ul>\n<h3>Shapes and Paths</h3>\n<p>To get the best results from SVG icons paths and shapes should be aligned to the pixel.</p>\n<h2>Anatomy of a SVG</h2>\n<p>Lets examine a common SVG glyph, an arrow made from 3 <code>&#x3C;path></code> objects aligned to the centre of a 16px <code>viewBox</code>.</p>\n<svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 16 16">\n  <g fill="none" fill-rule="evenodd" stroke="#000000" stroke-width="1" stroke-linecap="square" transform="translate(1 .5)">\n    <path d="M0.5,7.5 L12.5,7.5"/>\n    <path d="M13.5,7.5 L6.5,14.5"/>\n    <path d="M13.5,7.5 L7,1"/>\n  </g>\n</svg>\n<p>This glyph is created with the following SVG markup:</p>\n<pre><code class="language-html">&#x3C;svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 16 16">\n  &#x3C;g fill="none" fill-rule="evenodd" stroke="#000000" stroke-width="1" stroke-linecap="square" transform="translate(1 .5)">\n    &#x3C;path d="M0.5,7.5 L12.5,7.5"/>\n    &#x3C;path d="M13.5,7.5 L6.5,14.5"/>\n    &#x3C;path d="M13.5,7.5 L7,1"/>\n  &#x3C;/g>\n&#x3C;/svg>\n</code></pre>\n<p>Broken down into it\'s individual parts the glyph can be constructed with:</p>\n<h3>The SVG tag</h3>\n<p>A doctype expressed by <code>xmlns="http://www.w3.org/2000/svg"</code></p>\n<p>A <code>viewBox</code> of 16px <code>viewBox="0 0 16 16"</code> which states the <code>viewBox</code> dartboard or canvas position as being\n4. x1 = 0\n5. y1 = 0\n6. x2 = 16px\n7. y2 = 16px</p>\n<p>A <code>width</code> of <code>16px</code> set with the attribute <code>width="16"</code></p>\n<p>A <code>height</code> of <code>16px</code> set with the attribute <code>height="16"</code></p>\n<h3>The group tag</h3>\n<p>A group tag <code>&#x3C;g></code> wraps all required <code>&#x3C;path></code> tags and applies:</p>\n<ol>\n<li>A <code>fill</code> of <code>none</code> with the attribute <code>fill="none"</code></li>\n<li>A <code>fill-rule</code> of <code>even-odd</code> with the attribute <code>fill-rule="evenodd"</code></li>\n<li>A <code>stroke</code> of <code>#000000</code> (or black) with the attribute <code>stroke="#000000"</code></li>\n<li>A <code>stroke-width</code> of <code>1px</code> with the attribute <code>stroke-width="1"</code></li>\n<li>A <code>stroke-linecap</code> of <code>square</code> with the attribute <code>stroke-linecap="square"</code></li>\n<li>A transform to centre the icon onto the artboard, moving the glyph to 1px in from the left and 0.5px in from the top with the attribute <code>transform="translate(1 .5)"</code></li>\n</ol>\n<h3>The path(s)</h3>\n<p>3 × <code>&#x3C;path></code> objects that specify the lines of the arrow</p>\n<p>From <a href="(https://css-tricks.com/svg-path-syntax-illustrated-guide/)">The SVG <code>path</code> Syntax: An Illustrated Guide</a></p>\n<blockquote>\n<p>The <code>&#x3C;path></code> element in SVG is the ultimate drawing element. It can draw anything! I\'ve heard that under the hood all the other drawing elements ultimately use path anyway. The path element takes a single attribute to describe what it draws: the d attribute. The value it has is a mini syntax all to itself. It can look pretty indecipherable. It\'s a ton of numbers and letters smashed together into a long string. Like anything computers, there is a reason to the rhyme.</p>\n</blockquote>\n<p><code>&#x3C;path d="M0.5,7.5 L12.5,7.5"/></code></p>\n<svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 16 16">\n  <g fill="none" fill-rule="evenodd" stroke="#000000" stroke-width="1" stroke-linecap="square" transform="translate(1 .5)">\n    <path d="M0.5,7.5 L12.5,7.5"/>\n  </g>\n</svg>\n<p><code>&#x3C;path d="M13.5,7.5 L6.5,14.5"/></code></p>\n<svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 16 16">\n  <g fill="none" fill-rule="evenodd" stroke="#000000" stroke-width="1" stroke-linecap="square" transform="translate(1 .5)">\n    <path d="M13.5,7.5 L6.5,14.5"/>\n  </g>\n</svg>\n<p><code>&#x3C;path d="M13.5,7.5 L7,1"/></code></p>\n<svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 16 16">\n  <g fill="none" fill-rule="evenodd" stroke="#000000" stroke-width="1" stroke-linecap="square" transform="translate(1 .5)">\n    <path d="M13.5,7.5 L7,1"/>\n  </g>\n</svg>\n<h2>Scale</h2>\n<p>The scale of the glyph is updated by increasing the <code>width</code> and <code>height</code> attributes on the <code>&#x3C;svg></code> tag, this scales the <code>viewBox</code> to the new width and height.</p>\n<p>The <code>width</code> and <code>height</code> attributes can take any CSS property value, for example, <code>1em</code> or <code>1rem</code> for relative scaling to font size. </p>\n<svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 16 16">\n  <g fill="none" fill-rule="evenodd" stroke="#000000" stroke-width="1" stroke-linecap="square" transform="translate(1 .5)">\n    <path d="M0.5,7.5 L12.5,7.5"/>\n    <path d="M13.5,7.5 L6.5,14.5"/>\n    <path d="M13.5,7.5 L7,1"/>\n  </g>\n</svg>\n<pre><code class="language-html">&#x3C;svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 16 16">\n  &#x3C;g fill="none" fill-rule="evenodd" stroke="#000000" stroke-width="1" stroke-linecap="square" transform="translate(1 .5)">\n    &#x3C;path d="M0.5,7.5 L12.5,7.5"/>\n    &#x3C;path d="M13.5,7.5 L6.5,14.5"/>\n    &#x3C;path d="M13.5,7.5 L7,1"/>\n  &#x3C;/g>\n&#x3C;/svg>\n</code></pre>\n<h2>Style</h2>\n<p>The attributes set on the group tag <code>&#x3C;g></code> that wraps the individual <code>&#x3C;path></code> objects can be used to change the style of the glyph, for example:</p>\n<p>Updating the <code>stroke</code> attribute:</p>\n<svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 16 16">\n  <g fill="none" fill-rule="evenodd" stroke="red" stroke-width="1" stroke-linecap="square" transform="translate(1 .5)">\n    <path d="M0.5,7.5 L12.5,7.5"/>\n    <path d="M13.5,7.5 L6.5,14.5"/>\n    <path d="M13.5,7.5 L7,1"/>\n  </g>\n</svg>\n<p>Updating the <code>stroke-width</code> attribute for a bolder glyph</p>\n<svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 16 16">\n  <g fill="none" fill-rule="evenodd" stroke="#000000" stroke-width="2" stroke-linecap="square" transform="translate(1 .5)">\n    <path d="M0.5,7.5 L12.5,7.5"/>\n    <path d="M13.5,7.5 L6.5,14.5"/>\n    <path d="M13.5,7.5 L7,1"/>\n  </g>\n</svg>\n<p>Updating the <code>stroke-width</code> <code>stroke-linecap</code> attribute for a bolder rounded glyph</p>\n<svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 16 16">\n  <g fill="none" fill-rule="evenodd" stroke="#000000" stroke-width="2" stroke-linecap="round" transform="translate(1 .5)">\n    <path d="M0.5,7.5 L12.5,7.5"/>\n    <path d="M13.5,7.5 L6.5,14.5"/>\n    <path d="M13.5,7.5 L7,1"/>\n  </g>\n</svg>\n<h2>Meaning</h2>\n<p>Providing meaning to an icon glyph is done through the SVG <code>&#x3C;title></code> and <code>&#x3C;desc></code> tags, these can be used by screen readers through the <code>aria-labeledby</code> attribute and parsing in the values, for example, <code>aria-labelledby="title desc"</code>.</p>\n<pre><code class="language-html">&#x3C;svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 16 16" aria-labelledby="title desc">\n&#x3C;title id="title">Arrow Right&#x3C;/title>\n&#x3C;desc id="desc">A black arrow pointing to the right&#x3C;/desc>\n...\n&#x3C;/svg>\n</code></pre>\n<h2>Preparation</h2>\n<h3>Individual artboards</h3>\n<h3>Naming convention</h3>\n<h3>Organisation</h3>\n<h2>Export</h2>\n<h3>Illustrator</h3>\n<h3>Sketch</h3>\n<h4>Sketch SVGO Plugin</h4>\n<h2>Optimisation</h2>\n<p>From <a href="(https://github.com/svg/svgo)">SVGO</a></p>\n<blockquote>\n<p>SVG files, especially exported from various editors, usually contain a lot of redundant and useless information such as editor metadata, comments, hidden elements, default or non-optimal values and other stuff that can be safely removed or converted without affecting SVG rendering result.</p>\n</blockquote>\n<h2>Usage</h2>\n<h3>Inline</h3>\n<h4>Pros</h4>\n<ul>\n<li>Customisability</li>\n</ul>\n<h4>Cons</h4>\n<ul>\n<li>Caching</li>\n</ul>\n<h3>Uses</h3>\n<h3>Spritesheets</h3>',id:"/Users/bigfish/Projects/guide/src/pages/navigation/index.md absPath of file >>> MarkdownRemark",timeToRead:5,frontmatter:{path:"/svg",tags:["svg"],title:"SVG"}}}}}});
//# sourceMappingURL=path---example-1dddf94981c4178faec7.js.map